const mapStyle = { height: "90vh" };

const VenueMarkers = ({ venues }) => {
  console.log(venues[6]);

  const markers = venues
    .filter((venue) => venue.Bedrooms >= 2 && venue.PostalCode.includes("H1N"))
    .map((venue, index) => (
      <Marker text={index} position={[venue.lat, venue.long]}></Marker>
    ));

  return <Fragment>{markers}</Fragment>;
};

